import styled from '@emotion/styled';

const Outline = styled.div`
  border: 1px solid;
  margin-bottom: 40px;
`;

const Img = styled.img`
  max-width: 100%;
  height: auto;
`;

export const Card = {
  Outline,
  Img,
};

export default Card;
